// Initialize dimension analysis from Document Categorizer dispatch
const staticData = $getWorkflowStaticData('global');
const input = $input.first().json;

// Generate session/memory key
const sessionId = input.sessionId || `dim_${input.dimensionKey}_${Date.now()}`;
const memoryKey = `assessment_${sessionId}`;

// Store context
staticData.sessionId = sessionId;
staticData.memoryKey = memoryKey;
staticData.assessmentId = input.assessmentId;
staticData.versionId = input.versionId;
staticData.organizationId = input.organizationId;
staticData.dimensionKey = input.dimensionKey;
staticData.dimensionName = input.dimensionName;
staticData.dimensionWeight = input.dimensionWeight;
staticData.dimensionQuestions = input.dimensionQuestions || [];
staticData.scoringModel = input.scoringModel || {};
staticData.assessmentType = input.assessmentType;
staticData.companyName = input.companyName;
staticData.companyDomain = input.companyDomain;
staticData.classification = input.classification || {};
staticData.playbookContent = input.playbookContent || null;

// Analysis type is now 'strategic' (document-based)
staticData.analysisType = 'strategic';
staticData.startedAt = new Date().toISOString();

console.log(`=== Dimension Analysis Started ===`);
console.log(`Session ID: ${sessionId}`);
console.log(`Memory Key: ${memoryKey}`);
console.log(`Company: ${staticData.companyName}`);
console.log(`Dimension: ${staticData.dimensionName} (${staticData.dimensionKey})`);
console.log(`Weight: ${staticData.dimensionWeight}`);

return [{
  json: {
    sessionId: sessionId,
    memoryKey: memoryKey,
    versionId: staticData.versionId,
    assessmentId: staticData.assessmentId,
    dimensionKey: staticData.dimensionKey,
    organizationId: staticData.organizationId
  }
}];

// Store prior analysis AND playbook in staticData
const staticData = $getWorkflowStaticData('global');
const priorResults = $input.all();

// Get trigger data directly since staticData might not be populated yet
const triggerData = $('Dimension Analysis Trigger').first().json;
const dimensionKey = staticData.dimensionKey || triggerData?.dimensionKey;
const dimensionName = staticData.dimensionName || triggerData?.dimensionName;

console.log('=== STORING PLAYBOOK ===');
console.log('Looking for dimension - key:', dimensionKey, ', name:', dimensionName);

// Store playbook content from Get Playbook node
const playbookData = $('Get Playbook').first().json;

if (playbookData && playbookData.content) {
  try {
    const parsedPlaybook = typeof playbookData.content === 'string' 
      ? JSON.parse(playbookData.content) 
      : playbookData.content;

    if (parsedPlaybook.dimensions && parsedPlaybook.dimensions.length > 0) {
      let dimensionSection = null;

      // First try to match by key
      if (dimensionKey) {
        dimensionSection = parsedPlaybook.dimensions.find(d => {
          return d.key === dimensionKey || d.key?.toLowerCase() === dimensionKey?.toLowerCase();
        });
        if (dimensionSection) {
          console.log('Matched by key:', dimensionKey);
        }
      }

      // Fallback to match by name
      if (!dimensionSection && dimensionName) {
        dimensionSection = parsedPlaybook.dimensions.find(d => {
          return d.name === dimensionName || d.name?.toLowerCase() === dimensionName?.toLowerCase();
        });
        if (dimensionSection) {
          console.log('Matched by name:', dimensionName);
        }
      }

      if (dimensionSection) {
        staticData.dimensionPlaybook = dimensionSection;
        console.log('Found matching dimension:', dimensionSection.name);
        console.log('Questions count:', dimensionSection.questions?.length || 0);
      } else {
        console.log('No matching dimension found');
        console.log('Available keys:', parsedPlaybook.dimensions.map(d => d.key).join(', '));
        console.log('Available names:', parsedPlaybook.dimensions.map(d => d.name).join(', '));
      }
    }
  } catch (e) {
    console.log('Failed to parse playbook content:', e.message);
  }
} else {
  console.log('No playbook content found');
}

// Store prior analysis
console.log('=== STORING PRIOR ANALYSIS ===');
console.log('priorResults length:', priorResults.length);

if (priorResults.length > 0 && priorResults[0].json.id) {
  staticData.priorAnalysis = priorResults[0].json;
  console.log('Found prior analysis: Score=' + staticData.priorAnalysis.raw_score + ', Confidence=' + staticData.priorAnalysis.confidence_score);
} else {
  staticData.priorAnalysis = null;
  console.log('No prior analysis found - starting fresh');
}

// Pass through to next node
return [{
  json: {
    versionId: triggerData?.versionId,
    dimensionKey: dimensionKey,
    dimensionName: dimensionName,
    assessmentId: triggerData?.assessmentId,
    hasPriorAnalysis: !!staticData.priorAnalysis,
    hasDimensionPlaybook: !!staticData.dimensionPlaybook
  }
}];

// Enrich documents with relevance scores from assignments
const staticData = $getWorkflowStaticData('global');
const documents = $input.all().map(i => i.json);
const assignments = $('Get Dimension Assignments').all().map(i => i.json);

console.log(`Documents found: ${documents.length}`);
console.log(`Assignments: ${assignments.length}`);

// Create relevance lookup
const relevanceMap = new Map();
assignments.forEach(a => {
  relevanceMap.set(a.document_id, a.relevance_score);
});

// Enrich and sort by relevance
const enrichedDocs = documents
  .map(doc => ({
    ...doc,
    document_content_id: doc.id,
    relevance_score: relevanceMap.get(doc.document_id) || 50,
    content: doc.extracted_content,
    session_id: staticData.sessionId
  }))
  .sort((a, b) => b.relevance_score - a.relevance_score);

if (enrichedDocs.length === 0) {
  return [{ json: { hasDocs: false, documentCount: 0 } }];
}

staticData.totalRelevantDocs = enrichedDocs.length;

return enrichedDocs.map(doc => ({
  json: { hasDocs: true, ...doc }
}));

// No documents to analyze
const staticData = $getWorkflowStaticData('global');

return [{
  json: {
    success: true,
    message: `No new documents to analyze for ${staticData.dimensionName}`,
    dimension_key: staticData.dimensionKey,
    documents_analyzed: 0
  }
}];

// Smart Document Batcher - Groups by model and creates optimal batches
// Splits large documents that exceed token limits
const staticData = $getWorkflowStaticData('global');
const items = $input.all();
const sessionId = staticData.sessionId;
const memoryKey = staticData.memoryKey;

console.log('=== SMART DOCUMENT BATCHER ===');
console.log(`Total documents: ${items.length}`);

// Document splitting config
const MAX_DOC_TOKENS = 80000;  // Split docs larger than this
const CHUNK_SIZE = 60000;      // Target chunk size in tokens
const CHUNK_OVERLAP = 2000;    // Overlap between chunks for context

// Batch configs per model
const BATCH_CONFIGS = {
  'sonnet': { maxDocsPerBatch: 7, maxTokensPerBatch: 100000, costPerBatch: 0.15 },
  'opus': { maxDocsPerBatch: 3, maxTokensPerBatch: 150000, costPerBatch: 1.50 }
};

// Helper: Estimate tokens from char count
const estimateTokens = (charCount) => Math.ceil(charCount / 3.5);

// Helper: Estimate chars from token count
const estimateChars = (tokenCount) => Math.floor(tokenCount * 3.5);

// Helper: Split large document into chunks
const splitDocument = (doc) => {
  const content = doc.content || doc.extracted_content || '';
  const totalChars = content.length;
  const totalTokens = doc.token_count || estimateTokens(totalChars);

  if (totalTokens <= MAX_DOC_TOKENS) {
    return [doc]; // No split needed
  }

  console.log(`Splitting large document ${doc.document_id}: ${totalTokens} tokens`);

  const chunks = [];
  const chunkCharSize = estimateChars(CHUNK_SIZE);
  const overlapChars = estimateChars(CHUNK_OVERLAP);

  let startIndex = 0;
  let chunkNumber = 1;

  while (startIndex < totalChars) {
    let endIndex = Math.min(startIndex + chunkCharSize, totalChars);

    // Try to break at a paragraph or sentence boundary
    if (endIndex < totalChars) {
      const searchStart = Math.max(endIndex - 500, startIndex);
      const searchText = content.substring(searchStart, endIndex);

      // Look for paragraph break first
      const paragraphBreak = searchText.lastIndexOf('\n\n');
      if (paragraphBreak > 0) {
        endIndex = searchStart + paragraphBreak + 2;
      } else {
        // Look for sentence break
        const sentenceBreak = searchText.lastIndexOf('. ');
        if (sentenceBreak > 0) {
          endIndex = searchStart + sentenceBreak + 2;
        }
      }
    }

    const chunkContent = content.substring(startIndex, endIndex);
    const chunkTokens = estimateTokens(chunkContent.length);

    chunks.push({
      ...doc,
      document_id: `${doc.document_id}_chunk${chunkNumber}`,
      original_document_id: doc.document_id,
      document_content_id: doc.document_content_id || doc.id,
      content: chunkContent,
      char_count: chunkContent.length,
      token_count: chunkTokens,
      is_chunk: true,
      chunk_number: chunkNumber,
      total_chunks: null, // Will update after
      chunk_start_char: startIndex,
      chunk_end_char: endIndex
    });

    // Move start with overlap
    startIndex = endIndex - overlapChars;
    if (startIndex >= totalChars - overlapChars) {
      startIndex = totalChars; // Prevent tiny last chunk
    }
    chunkNumber++;
  }

  // Update total_chunks
  chunks.forEach(chunk => {
    chunk.total_chunks = chunks.length;
  });

  console.log(`Split into ${chunks.length} chunks`);
  return chunks;
};

// Process all documents - split large ones
const processedDocs = [];
items.forEach(item => {
  const doc = item.json;
  const chunks = splitDocument(doc);
  processedDocs.push(...chunks);
});

console.log(`After splitting: ${processedDocs.length} documents/chunks`);

// Group by model type
const documentsByModel = { 'sonnet': [], 'opus': [] };

processedDocs.forEach(doc => {
  const model = doc.assigned_model || 'sonnet';
  if (documentsByModel[model]) {
    documentsByModel[model].push(doc);
  } else {
    documentsByModel['sonnet'].push(doc);
  }
});

console.log(`Sonnet docs: ${documentsByModel.sonnet.length}`);
console.log(`Opus docs: ${documentsByModel.opus.length}`);

// Create batches
const allBatches = [];
let batchCounter = 0;

Object.entries(documentsByModel).forEach(([modelType, docs]) => {
  if (docs.length === 0) return;

  const config = BATCH_CONFIGS[modelType];
  let currentBatch = [];
  let currentTokens = 0;

  docs.forEach((doc) => {
    const docTokens = doc.token_count || estimateTokens(doc.char_count || 0);

    // Check if adding this doc would exceed limits
    if ((currentTokens + docTokens > config.maxTokensPerBatch || 
         currentBatch.length >= config.maxDocsPerBatch) && 
        currentBatch.length > 0) {
      // Save current batch
      batchCounter++;
      allBatches.push({
        batchId: `batch_${batchCounter}_${modelType}`,
        batchNumber: batchCounter,
        modelType: modelType,
        documents: currentBatch,
        documentCount: currentBatch.length,
        documentIds: currentBatch.map(d => d.document_id),
        documentContentIds: [...new Set(currentBatch.map(d => d.document_content_id || d.id).filter(Boolean))],
        totalTokens: currentTokens,
        estimatedCost: config.costPerBatch,
        sessionId: sessionId,
        memoryKey: memoryKey,
        hasChunkedDocs: currentBatch.some(d => d.is_chunk)
      });
      currentBatch = [];
      currentTokens = 0;
    }

    currentBatch.push(doc);
    currentTokens += docTokens;
  });

  // Don't forget the last batch
  if (currentBatch.length > 0) {
    batchCounter++;
    allBatches.push({
      batchId: `batch_${batchCounter}_${modelType}`,
      batchNumber: batchCounter,
      modelType: modelType,
      documents: currentBatch,
      documentCount: currentBatch.length,
      documentIds: currentBatch.map(d => d.document_id),
      documentContentIds: [...new Set(currentBatch.map(d => d.document_content_id || d.id).filter(Boolean))],
      totalTokens: currentTokens,
      estimatedCost: config.costPerBatch,
      sessionId: sessionId,
      memoryKey: memoryKey,
      hasChunkedDocs: currentBatch.some(d => d.is_chunk)
    });
  }
});

// Store batch plan in staticData
staticData.batchPlan = {
  totalBatches: allBatches.length,
  totalDocuments: items.length,
  totalChunks: processedDocs.length,
  documentsWereSplit: processedDocs.length > items.length,
  estimatedCost: allBatches.reduce((sum, b) => sum + b.estimatedCost, 0)
};

console.log(`Total batches: ${allBatches.length}`);
console.log(`Documents split: ${processedDocs.length > items.length}`);
console.log(`Estimated cost: $${staticData.batchPlan.estimatedCost.toFixed(2)}`);

return allBatches.map(batch => ({ json: batch }));

// UPDATED Memory Manager - Implements Quick Win #1 and #2
// This prepares the batch data with incremental analysis and playbook caching

const staticData = $getWorkflowStaticData('global');
const batch = $input.first().json;
const sessionId = staticData.sessionId;
const memoryKey = staticData.memoryKey;
const dimensionKey = staticData.dimensionKey;

console.log(`\n=== MEMORY MANAGER (Quick Wins Enabled) ===`);
console.log(`Batch ${batch.batchNumber} of ${staticData.batchPlan?.totalBatches || '?'}`);
console.log(`Model: ${batch.modelType}`);

// PLAYBOOK: Always send full playbook for every batch
const isFirstBatch = batch.batchNumber === 1;
let playbookSection = '';
let playbookReference = null;

if (staticData.dimensionPlaybook) {
  playbookSection = JSON.stringify(staticData.dimensionPlaybook, null, 2);

  staticData.fullPlaybookSent = true;
  staticData.playbookLength = playbookSection.length;

  console.log('Sending FULL playbook');
  console.log(`   Playbook size: ${playbookSection.length} chars (~${Math.ceil(playbookSection.length/4)} tokens)`);
} else {
  console.warn('No dimensionPlaybook found in staticData');
  playbookSection = 'PLAYBOOK SECTION\n[Playbook content not available]';
}

// Get memory context
const memoryContext = staticData.compressedMemory?.[sessionId] || {};

// Prepare documents for analysis
const documentsForAnalysis = [];
const documentIds = [];
const batchDocs = batch.documents || [];

batchDocs.forEach((doc, index) => {
  const docData = doc.json || doc;

  if (docData.content) {
    documentsForAnalysis.push({
      documentId: docData.document_id || docData.id || `doc_${index}`,
      content: docData.content,
      category: docData.category || 'UNKNOWN',
      complexity: docData.complexity_score || 0,
      relevance: docData.relevance_score || 0
    });

    documentIds.push(docData.document_id || docData.id || `doc_${index}`);
  }
});

if (documentsForAnalysis.length === 0) {
  console.error('No documents with content found in batch!');
}

// Calculate token estimates
const CHARS_PER_TOKEN = 4;
const playbookTokens = Math.ceil(playbookSection.length / CHARS_PER_TOKEN);
const documentsTokens = Math.ceil(
  documentsForAnalysis.reduce((sum, doc) => sum + doc.content.length, 0) / CHARS_PER_TOKEN
);
const memoryTokens = Math.ceil(JSON.stringify(memoryContext).length / CHARS_PER_TOKEN);

console.log('\nToken Estimates:');
console.log(`  Playbook: ${playbookTokens} tokens`);
console.log(`  Documents: ${documentsTokens} tokens`);
console.log(`  Memory: ${memoryTokens} tokens`);

// QUICK WIN #1: ADD FULL PRIOR ANALYSIS
const priorDimensionAnalysis = staticData.priorAnalysis || null;
const priorTokens = priorDimensionAnalysis ? 
  Math.ceil(JSON.stringify(priorDimensionAnalysis).length / CHARS_PER_TOKEN) : 0;

if (priorDimensionAnalysis) {
  console.log(`  Prior Analysis: ${priorTokens} tokens`);
  console.log('QUICK WIN #1: Including full prior analysis for incremental mode');
} else {
  console.log('  Prior Analysis: None (first analysis)');
}

const totalEstimatedTokens = playbookTokens + documentsTokens + memoryTokens + priorTokens + 2000;
console.log(`  TOTAL ESTIMATED: ${totalEstimatedTokens} tokens`);
console.log(`  Estimated cost: $${(totalEstimatedTokens * 0.000015).toFixed(3)}`);

// Truncate if needed based on model limits
const MAX_TOKENS = batch.modelType === 'opus-4.1' ? 180000 : 150000;
const SAFE_LIMIT = MAX_TOKENS * 0.8;

if (totalEstimatedTokens > SAFE_LIMIT) {
  console.warn(`Approaching token limit (${totalEstimatedTokens}/${SAFE_LIMIT})`);
  console.warn('   Truncating documents...');

  const availableForDocs = SAFE_LIMIT - playbookTokens - memoryTokens - priorTokens - 2000;
  const truncationRatio = availableForDocs / documentsTokens;

  documentsForAnalysis.forEach(doc => {
    if (truncationRatio < 1) {
      const newLength = Math.floor(doc.content.length * truncationRatio);
      doc.content = doc.content.substring(0, newLength) + '\n[... TRUNCATED FOR TOKEN LIMITS ...]';
      doc.truncated = true;
    }
  });
}

// Build processing metadata
const processingMetadata = {
  batchNumber: batch.batchNumber || 1,
  totalBatches: staticData.batchPlan?.totalBatches || 1,
  documentsIncluded: documentsForAnalysis.length,
  documentIds: documentIds,
  tokensUsed: totalEstimatedTokens,
  modelType: batch.modelType,
  truncationApplied: documentsForAnalysis.some(d => d.truncated),
  quickWinsEnabled: true,
  playbookCached: false,
  incrementalMode: !!priorDimensionAnalysis
};

// Build output with BOTH quick wins
const outputData = {
  // Core identifiers
  batchId: batch.batchId,
  sessionId: sessionId,
  memoryKey: memoryKey,
  modelType: batch.modelType,

  // Playbook - always full
  playbookSection: playbookSection,
  playbookReference: playbookReference,
  isFirstBatch: isFirstBatch,

  // QUICK WIN #1: Full prior analysis for incremental mode
  priorAnalysis: priorDimensionAnalysis,
  hasPriorAnalysis: !!priorDimensionAnalysis,

  // Documents and context
  documentsForAnalysis: documentsForAnalysis,
  memoryContext: memoryContext,
  processingMetadata: processingMetadata,

  // Pass through documentContentIds from batch for downstream processing
  documentContentIds: batch.documentContentIds || [],

  // Batch info
  batchInfo: {
    currentBatch: batch.batchNumber || 1,
    totalBatches: staticData.batchPlan?.totalBatches || 1,
    documentsInBatch: documentsForAnalysis.length,
    estimatedCost: batch.estimatedCost || 0.30
  },

  // Tracking
  timestamp: new Date().toISOString(),
  dimensionKey: dimensionKey,
  dimensionName: staticData.dimensionName
};

console.log('\n=== OUTPUT PREPARED ===');
console.log(`Batch ID: ${outputData.batchId}`);
console.log(`Documents: ${outputData.documentsForAnalysis.length}`);
console.log(`Has Prior Analysis: ${outputData.hasPriorAnalysis}`);
console.log(`Playbook Cached: false (always full)`);
console.log(`Model: ${outputData.modelType}`);
console.log(`Document Content IDs: ${outputData.documentContentIds.length}`);
console.log('========================\n');

return [{ json: outputData }];

// Parse agent output and prepare for database operations
const staticData = $getWorkflowStaticData('global');
const triggerData = $('Dimension Analysis Trigger').first().json;
const aiOutput = $input.first().json;

// Get batch context from Memory Manager
const batchContext = $('Memory Manager').first().json;

// Handle both string and object outputs
let analysis;
if (typeof aiOutput.output === 'string') {
  // Try to parse string output
  const outputString = aiOutput.output;
  try {
    analysis = JSON.parse(outputString);
  } catch (e) {
    const jsonMatch = outputString.match(/```(?:json)?\n?([\s\S]*?)\n?```/);
    if (jsonMatch) {
      analysis = JSON.parse(jsonMatch[1]);
    } else {
      const objectMatch = outputString.match(/\{[\s\S]*\}/);
      if (objectMatch) {
        analysis = JSON.parse(objectMatch[0]);
      } else {
        throw new Error('Could not parse analysis output');
      }
    }
  }
} else if (typeof aiOutput.output === 'object' && aiOutput.output !== null) {
  // Output is already an object
  analysis = aiOutput.output;
} else if (typeof aiOutput === 'object' && aiOutput.raw_score !== undefined) {
  // The entire aiOutput is the analysis
  analysis = aiOutput;
} else {
  throw new Error('Unexpected output format: ' + typeof aiOutput.output);
}

// Get values from staticData or trigger
const dimensionKey = staticData.dimensionKey || triggerData.dimensionKey;
const dimensionName = staticData.dimensionName || triggerData.dimensionName;
const dimensionWeight = staticData.dimensionWeight || triggerData.dimensionWeight || 1;
const versionId = staticData.versionId || triggerData.versionId;
const assessmentId = staticData.assessmentId || triggerData.assessmentId;

// Calculate weighted score
const weightedScore = parseFloat((analysis.raw_score * dimensionWeight).toFixed(2));

// Determine confidence category if not provided
let confidenceCategory = analysis.confidence_category;
if (!confidenceCategory) {
  const conf = analysis.confidence_score || 0;
  if (conf >= 90) confidenceCategory = 'verified';
  else if (conf >= 70) confidenceCategory = 'validated';
  else if (conf >= 50) confidenceCategory = 'informed_estimate';
  else if (conf >= 30) confidenceCategory = 'low_confidence';
  else confidenceCategory = 'insufficient_data';
}

// Determine maturity level if not provided
let maturityLevel = analysis.maturity_level;
if (!maturityLevel) {
  if (analysis.raw_score >= 71) maturityLevel = 'run';
  else if (analysis.raw_score >= 41) maturityLevel = 'walk';
  else maturityLevel = 'crawl';
}

// Build the analysis record
const analysisRecord = {
  version_id: versionId,
  assessment_id: assessmentId,
  dimension_key: dimensionKey,
  dimension_name: dimensionName,
  dimension_weight: dimensionWeight,
  analysis_type: 'strategic',
  raw_score: analysis.raw_score,
  weighted_score: weightedScore,
  maturity_level: maturityLevel,
  confidence_score: analysis.confidence_score || 0,
  confidence_category: confidenceCategory,
  analysis_summary: analysis.analysis_summary || '',
  full_analysis: analysis.full_analysis || analysis,
  strengths: analysis.strengths || [],
  gaps: analysis.gaps || [],
  recommendations: analysis.recommendations || [],
  model_used: batchContext.modelType === 'opus' ? 'claude-opus-4' : 'claude-sonnet-4',
  completed_at: new Date().toISOString()
};

console.log('Analysis prepared: Score=' + analysis.raw_score + ', Confidence=' + analysis.confidence_score);

return [{
  json: {
    analysisRecord: analysisRecord,
    documentContentIds: batchContext.documentContentIds,
    versionId: versionId,
    dimensionKey: dimensionKey
  }
}];

// Return success for this batch
const prepData = $('Prepare Analysis Record').first().json;

return [{
  json: {
    batchComplete: true,
    documentsMarked: prepData.documentContentIds.length,
    score: prepData.analysisRecord.raw_score,
    confidence: prepData.analysisRecord.confidence_score
  }
}];

// Final success - all batches complete
const staticData = $getWorkflowStaticData('global');

return [{
  json: {
    success: true,
    message: `Dimension analysis completed for ${staticData.dimensionName}`,
    dimension_key: staticData.dimensionKey,
    dimension_name: staticData.dimensionName,
    total_batches: staticData.batchPlan?.totalBatches || 1,
    total_documents: staticData.totalRelevantDocs || 0,
    completed_at: new Date().toISOString()
  }
}];

// Split documentContentIds into separate items for Mark Documents Analyzed
const input = $input.first().json;
const documentIds = (input.documentContentIds || []).filter(id => id != null && id !== '');

console.log(`Document content IDs to mark as analyzed: ${documentIds.length}`, documentIds);

if (documentIds.length === 0) {
  console.warn('No valid documentContentIds found - skipping mark as analyzed');
  return [];
}

return documentIds.map(docId => ({
  json: {
    documentContentId: docId,
    versionId: input.versionId,
    dimensionKey: input.dimensionKey
  }
}));

// Parse JSON from agent raw text output
const input = $input.first().json;

// If already an object with our expected fields, pass through
if (input.raw_score !== undefined && input.full_analysis !== undefined) {
  return [{ json: input }];
}

// Get the text output from the agent
const text = input.output || input.text || (typeof input === 'string' ? input : JSON.stringify(input));

// Try to extract JSON from the text
let parsed = null;
try {
  parsed = JSON.parse(text);
} catch (e) {
  // Try to find JSON block in markdown code fences
  const jsonMatch = text.match(/```(?:json)?\s*([\s\S]*?)```/);
  if (jsonMatch) {
    try {
      parsed = JSON.parse(jsonMatch[1].trim());
    } catch (e2) {
      // fall through
    }
  }
  if (!parsed) {
    // Try to find first { to last }
    const start = text.indexOf('{');
    const end = text.lastIndexOf('}');
    if (start !== -1 && end !== -1 && end > start) {
      try {
        parsed = JSON.parse(text.substring(start, end + 1));
      } catch (e3) {
        return [{ json: { error: 'Failed to parse JSON from agent output', raw_output: text.substring(0, 2000) } }];
      }
    } else {
      return [{ json: { error: 'No JSON found in agent output', raw_output: text.substring(0, 2000) } }];
    }
  }
}

return [{ json: parsed }];
